sources.styles/blocks/up.scss:
.up {
  position: fixed;
  right: 20px;
  bottom: 30px;
  z-index: 10;
  width: 24px;
  height: 24px;
  background-image: url(../images/up.svg);
  background-position: center;
  background-repeat: no-repeat;
  text-shadow: 0 4px 4px rgba(0, 0, 0, 0.25);
  opacity: 0;
  transition: transform $transition-duration;
  @include onTablet {
    right: 30px;
  }
  @include onDesktop {
    right: 40px;
    bottom: 50px;
  }
  &:hover {
    transform: scale(110%);
    background-image: url(../images/up-h.svg);
  }
  &--show {
    opacity: 1;
    transform: rotate(1turn);
  }
}
